International transfers for 0%. The Zamzam mobile application is a profitable, fast and secure way to transfer money from Russia all over the world.

Zamzam is a financial assistant for a foreign citizen who has come to Russia to work, study, develop, create a better future for himself and his family.

Ways of sending and receiving transfers: 
From card to card (For those who value speed and convenience). 
From card to cash (For those who are used to going to the office and trusting cash). 

Features of the Zamzam app:
- Easy to send international transfers with 0% commission at a favorable rate; 
- Quickly pay for transfers from the card - no branches and queues; 
- Instantly credit transfers to Visa, MasterCard, ELCART, UZCARD, KortiMilly; 
- Receive cash transfers at 50,000 pick-up points around the world (coming soon); 
- Freely send transfers all over the world; 
- The app and support on 6 languages.

We transfer money from cards of any payment systems to Uzbekistan, Tajikistan, Kazakhstan, Kyrgyzstan, Armenia, Moldova, Israel and other counties. 

Coming soon in the Zamzam app:
- Virtual card with Apple Pay; 
- Money in instalments to the card of CIS citizens in 5 minutes; 
- Transfers between Zamzam cards without commission and conversion; 

Our team strives to combine in one application the most demanded financial and social services necessary for a foreign citizen to live comfortably in a new place.
Zamzam helps expats, international students, freelancers, and those living an international life send, receive and spend money safely, conveniently, and profitably. Join our ecosystem!

